import React from 'react';

export default function ModalPop(props) {
  submitTask = x => {
    console.log(x);
  };
  let box;
  if (props.data.completed) {
    box = (
      <div className="box green text-center">
        <h3 class="m-title">{props.name}</h3>
        <div class="text-center">
          <i class="fas fa-user"></i>
        </div>
        <button className="btn btn-lg btn-info" disable="true">
          Completed!
        </button>
      </div>
    );
  } else {
    box = (
      <div className="box text-center">
        <h3 class="m-title">{props.name}</h3>
        <div class="text-center">
          <i class="fas fa-user"></i>
        </div>
        <button
          onClick={() => {
            this.submitTask('hi');
          }}
          className="btn btn-lg btn-info"
        >
          Finish Task <i class="fas fa-caret-right"></i>
        </button>
      </div>
    );
  }
  return <div className="col-sm-4 p-1">{box}</div>;
}
